import React from "react";
import './style.css';

function Book(props) {
  return (
    <div className="bg-primary">
      <h3>{props.title}</h3>

      {props.authors.map(author => {
        return (
          <h6 key= {author}>Authors: {author}</h6>
        );
      })}
    </div>
  );
}

export default Book;
